    [],nt"num_tags": 3,nt"name": "identification-of-turbomachinery-noise-sources-using-acoustical-holography-project",nt"isopen":
    true,nt"url": null,nt"notes": "Evaluation and enhancement of the acoustical
    performance of turbomachinery requires knowledge of the acoustic sources. However,
    the noise generation mechanisms associated with turbomachinery are complex and as
    result it is not easy to identify these noise sources. The development of an integrated
    experimental/numerical technique that is based on holography and is applicable for
    the identification and ranking of complex noise sources is proposed. A new technique
    based on potential integral equations will be developed to rapidly evaluate the
    noise sources of complex structures. Generalized acoustical holography that is applicable
    for arbitrary geometry is extended by incorporating aeroacoustic noise sources in
    the presence of mean flow.",nt"owner_org": "d8a6202b-c0c3-463d-88a0-3bc021a178ed",nt"extras":
